function App() {
    const expenseData = [
        {
            id: 'e1',
            expenseTitle: 'Car Insurance',
            amount: 9999,
            date: new Date(2021, 2, 28),
        }, 
        {
            id: 'e2',
            expenseTitle: 'Car Insurance',
            amount: 9999,
            date: new Date(2021, 2, 28),
        },
         {
            id: 'e3',
            expenseTitle: 'Car Insurance',
            amount: 9999,
            date: new Date(2021, 2, 28),
        },
    ];

    return (
      <div  className="expenses">
        <NewExpenses></NewExpenses>
        <ExpensesFilter onFilter={OnDatechangeHandler}></ExpensesFilter>
        <Expenses className="expenses" items= {expenseData}></Expenses>
       </div>
    );
}

export default App;
